import React from 'react';

const MovieList = (props) => {
    return (
        <div className='row'>

            {props.movies.map((movie)= (
                <div className='col-lg-4'>
                <div className='card mb-4 shadow-sm '>
                    <img src={movie.imageURL} className='card-img-top' alt="Semple Movie" />
                     <div className='card-body'>
                        <h5 className='card-title'>Simple Movie</h5>
                        <p className='card-text'> Simple Movie Description</p>
                        <div className='d-flex justify-content-between align-items-center'>
                            <button className='btn btn-md btn-outline-danger'> Delete</button>
                            <h2> <span className='badge badge-info' >9.0</span> </h2>
                        </div>
                    </div>   
                </div>

            </div>

            ))}
            
        </div>
    );
};

export default MovieList;
